{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/amirmotefaker/uber-data-analysis-using-r?scriptVersionId=146558255\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"attachments":{"098e1013-e4f0-4e9d-ab63-9fbf152cbc6e.png":{"image/png":""}},"cell_type":"markdown","id":"613c1317","metadata":{"papermill":{"duration":0.01049,"end_time":"2023-10-14T10:38:11.707265","exception":false,"start_time":"2023-10-14T10:38:11.696775","status":"completed"},"tags":[]},"source":["# Uber Data Analysis using R\n","\n","- With over 118 million users, 5 million drivers, and 6.3 billion trips with 17.4 million trips completed per day - Uber is the company behind the data for moving people and making deliveries hassle-free.\n","- How are drivers assigned to riders cost-efficiently, and how is dynamic pricing leveraged to balance supply and demand? \n","- Thanks to the large volumes of data Uber collects and the fantastic team that handles Uber Data Analysis using Machine Learning tools and frameworks. \n","- If youre curious to learn more about how data analysis is done at Uber to ensure positive experiences for riders while making the ride profitable for the company - Get your hands dirty working with the Uber dataset to gain in-depth insights.\n","\n","\n","- Data storytelling is an important component of Machine Learning through which companies are able to understand the background of various operations. \n","- With the help of visualization, companies can avail the benefit of understanding complex data and gaining insights that would help them to craft decisions. \n","- This is more of a data visualization project that will guide you towards using the ggplot2 library for understanding the data and for developing an intuition for understanding the customers who avail the trips.\n","\n","- In this data analysis, we analyze Uber data from 1th April 2014 to 30th September 2014.\n","\n","- The goal of this project is to learn visualizations in R.\n","\n","- Dataset: [Kaggle](https://www.kaggle.com/datasets/amirmotefaker/uber-dataset-from-april-to-september-2014)\n","\n","![image.png](attachment:098e1013-e4f0-4e9d-ab63-9fbf152cbc6e.png)"]},{"cell_type":"markdown","id":"c27435fb","metadata":{"papermill":{"duration":0.00869,"end_time":"2023-10-14T10:38:11.724707","exception":false,"start_time":"2023-10-14T10:38:11.716017","status":"completed"},"tags":[]},"source":["# Import Libraries"]},{"cell_type":"code","execution_count":1,"id":"eac90ff2","metadata":{"execution":{"iopub.execute_input":"2023-10-14T10:38:11.747184Z","iopub.status.busy":"2023-10-14T10:38:11.744555Z","iopub.status.idle":"2023-10-14T10:38:12.69138Z","shell.execute_reply":"2023-10-14T10:38:12.689415Z"},"papermill":{"duration":0.960545,"end_time":"2023-10-14T10:38:12.693852","exception":false,"start_time":"2023-10-14T10:38:11.733307","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["\n","Attaching package: lubridate\n","\n","\n","The following objects are masked from package:base:\n","\n","    date, intersect, setdiff, union\n","\n","\n","\n","Attaching package: dplyr\n","\n","\n","The following objects are masked from package:stats:\n","\n","    filter, lag\n","\n","\n","The following objects are masked from package:base:\n","\n","    intersect, setdiff, setequal, union\n","\n","\n"]}],"source":["library(ggplot2)\n","library(ggthemes)\n","library(lubridate)\n","library(dplyr)\n","library(tidyr)\n","library(DT)\n","library(scales)\n","#library(data.table) # Import big files (CSV or Text) \n","#library(readxl) # Import Excel files"]},{"cell_type":"markdown","id":"7978fda0","metadata":{"papermill":{"duration":0.008976,"end_time":"2023-10-14T10:38:12.711803","exception":false,"start_time":"2023-10-14T10:38:12.702827","status":"completed"},"tags":[]},"source":["# Creating vector of colors for the plots"]},{"c